<script setup>
    import { Swiper, SwiperSlide } from 'swiper/vue'
    import 'swiper/css'
    import 'swiper/css/navigation'
    import 'swiper/css/pagination'
    import 'swiper/css/grid' 
    import { Navigation, Pagination, Grid } from 'swiper/modules'


