<template>
    <div class="full-row" id="my-portofolio">
        <div class="container">
            <div class="row">
                <div class="col-lg-12">
                    <h1 class="mb-5 text-uppercase">
                        My Portofolio 
                        <span class="text-primary">{{ portofolios.length }}</span>
                        <a href="" target="_blank">
                            <i class="fas fa-link" style="margin: 10px; font-size: 18px;"></i>
                        </a>
                    </h1>
                </div>
            </div>
        </div>
        <div class="container">
            <swiper
                  :modules="[Navigation, Pagination, Grid]"
                  navigation
                  pagination
                  @load="loading"
                  class="mySwiper "
                  :breakpoints="{
                    0: {
                        slidesPerView: 1,
                        slidesOffsetAfter: 40,
                        grid: {rows: 1, fill: 'row'}
                    },
                    768: {
                        slidesPerView: 2,
                        spaceBetween: 10,
                        slidesOffsetBefore: 1,
                        grid: {rows: 2, fill: 'row'}
                    },
                    1024: {
                        slidesPerView: 3,
                        spaceBetween: 20,
                        grid: {rows: 2, fill: 'row'}
                    },
                  }"
              >
                  <swiper-slide v-for="(portofolio, index) in portofolios" :key="index">
                      <div class="card card-portofolio">
                        <img 
                            class="card-img-top fixed-img" 
                            :src="portofolio.gambar ? portofolio.gambar : backup_img+portofolio.gambar_name"
                            @error="onImgError($event)" 
                            :alt="portofolio.app+' - '+portofolio.author"
                        >
                        <div class="card-body">
                            <a :href="portofolio.github_url" target="_blank" class="card-link">
                                <h6 class="card-title">{{ portofolio.app }}</h6>
                            </a>
                            <span 
                                v-for="(tool, index) in portofolio.tools.split(',')" 
                                :key="index" 
                                class="badge bg-primary m-1"
                            >{{ tool }}</span>
                        </div>
                      </div>
                  </swiper-slide>
              </swiper>
        </div>


    </div>
</template>

<script>
import projectjsondata from '../data/project.json'

export default {
    data() {
        return {
            loading: true,
            portofolios : [],
            projects_link: process.env.VUE_APP_PROJECTS_LINK,
            backup_img: `${window.location.origin}/assets/portofolio/`,
            fallbackImg: 'data:image/png;base64,',
        }
    },
    mounted() {
        this.fetch()
        
    },
    methods:{
        handleIframeLoad() {
            this.loading = false;
        },
        async fetch(){
            await Promise.all([
                this.Portofolio()
            ])
        },

        async Portofolio(){
            await fetch(this.$api)
            .then(response => response.json())
            .then(data => {
                this.portofolios = data
                
            }).catch(error => {
                console.log(error);

                this.portofolios = projectjsondata
            })
        },

        onImgError(e) {
            e.target.src = this.fallbackImg
        }
    }
}
</script>

